// Card 컴포넌트 예시
import React from 'react';

const Card = ({ game, addToCart }) => {
  return (
    <div className="game-card">
      <img src={game.imageUrl} alt={game.title} className="game-image" />
      <h3>{game.title}</h3>
      <p>{game.description}</p>
      <button onClick={() => addToCart(game)}>장바구니에 추가</button>
    </div>
  );
};

export default Card;
